import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchAllVotersAction } from '../redux/actions/action';
import VoterTable from './VoterTable';
import Pagination from '@mui/material/Pagination';
import Stack from '@mui/material/Stack';
import { Box, Typography, FormControl, Select, MenuItem } from '@mui/material';

const AllDataComponent = ({ boothName }) => {

  console.log("props in all data component boothName", boothName);
  const boothNames ="Mpp Primary School,Teki"

  const dispatch = useDispatch();
  const allVotersdata  = useSelector((state) => state.fetchAllVoters?.data);
  console.log("allVotersdata",allVotersdata)
  // , currentPage, totalPages
  const currentPage  = useSelector((state) => state.fetchAllVoters?.totalPages);
  console.log("allVotersdata",currentPage)
  const totalPages  = useSelector((state) => state.fetchAllVoters?.currentPage);
  console.log("allVotersdata",totalPages)

  const [page, setPage] = useState(1);


// if(boothName){}
  useEffect(() => {
     if(boothNames){
      dispatch(fetchAllVotersAction(page, boothNames));
     }
    console.log("useeffect touched boothName ----------------------->")
  }, [dispatch, page, boothName]);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  return (
    <>

        <VoterTable voters={allVotersdata} />


      {allVotersdata?.length !== 0 && (
        <Box sx={{ display: 'flex', justifyContent: 'center', mt: '10px' }}>
          <Stack spacing={2} direction="row">
            <Pagination
              count={totalPages}
              page={page}
              onChange={handleChangePage}
              sx={{
                '& .MuiPaginationItem-page.Mui-selected': { backgroundColor: '#EE8832', color: '#ffffff' },
                '& .MuiPaginationItemPage:hover': { backgroundColor: '#FFAA55', color: '#ffffff', },
              }}
            />
          </Stack>
        </Box>
      )}
    </>
  );
};

export default AllDataComponent;
